import React, { Component } from 'react'
import "./no_of_sem.css"
import { Button } from 'antd';

class no_of_sem extends Component {

    constructor(props) {
        super(props)

        this.state = {
            sems: ""
        }
    }
    handleSemsChange = (event) => {
        this.setState({
            sems: event.target.value
        });
    }
    render() {
        return (
            <form onSubmit={this.handleS}>
                <div className="title">
                    <label >
                        <h3>Number of Semesters:</h3>
                    </label>
                    <input type="text" value={this.state.sems} onChange={this.handleSemsChange} />
                    <div><Button type="primary"
                    onClick
                    >
                        Go</Button></div>
                </div>

            </form>
        )
    }
}

export default no_of_sem
